import React from "react"

const Button = ({ text, color, onClick, border = "0px", width, height, fontSize }) => {
    const getClass = () => {import("./styles.module.scss").then(imported => {
            console.log("Inside promise")
            console.log(imported.default[`${color}`])
            return imported.default[`${color}`]
        })
    }

    return (
        <button style={{ border: `${border}`,
            width: `${width}`,
            height: `${height}`,
            fontSize: `${fontSize}`
        }}
                onClick={() => onClick()}
                className={getClass()}>
            {text}
        </button>
    )
}

export default Button
